function CustomStyle({
  tokenId,
  block = tokenId,

  intensity = 1,
  period = 0.5,
  shift = 0,

  mod1 = intensity,
  mod2 = period,
  mod3 = shift,
  color1 = "#ffffff",
}) {
  console.log(`rendering`);

  // Refs
  const shuffleBag = useRef();
  const group = useRef();
  const hoistedValue = useRef();

  // Three
  const { size, camera, mouse, clock } = useThree();
  const { width, height } = size;

  // Handle correct scaling of scene as canvas is resized, and when generating upscaled version.
  useEffect(() => {
    console.log(`updating camera...`);
    let DEFAULT_SIZE = 500;
    let DIM = Math.min(width, height);
    let M = DIM / DEFAULT_SIZE;
    camera.zoom = M * 200;
    camera.updateProjectionMatrix();
  }, [camera, width, height]);

  // Shuffle the random number bag when block changes
  const [jewelConfig, shapeConfig, colours, scale, symmetry, gltf] =
    useMemo(() => {
      console.log(`shuffling...`);
      const seed = block;
      shuffleBag.current = new MersenneTwist(seed);

      let ethTransferred = block;
      let avgGasPrice = block;
      console.log("ETH transferred: " + ethTransferred + " ETH");
      console.log("Average gas price: " + avgGasPrice + " Gwei");

      function getScale() {
        return (getModelCount() / 216) * -0.002 + 0.003;
      }

      function randomRotation() {
        return [
          shuffleBag.current.random() * 2 * Math.PI,
          shuffleBag.current.random() * 2 * Math.PI,
          shuffleBag.current.random() * 2 * Math.PI,
        ];
      }

      function randomPositionOnHemisphere() {
        let a = 2 * Math.PI * shuffleBag.current.random();
        let b = Math.acos(1 - 2 * shuffleBag.current.random());
        let x = Math.sin(a) * Math.sin(b);
        let y = Math.cos(a) * Math.sin(b);
        let z = Math.abs(Math.cos(b)) * -1;
        return [x, y, z];
      }

      function randomColoursFromPalettes(palette1, palette2, palette3) {
        return [
          palette1[Math.floor(shuffleBag.current.random() * palette1.length)],
          palette2[Math.floor(shuffleBag.current.random() * palette2.length)],
          palette3[Math.floor(shuffleBag.current.random() * palette3.length)],
        ];
      }

      function selectColours() {
        let scale = avgGasPrice / 250;
        switch (true) {
          case scale <= 0.125:
            return [
              "cobalt blues",
              randomColoursFromPalettes(blue1, blue1, blue1mono),
            ];
          case scale <= 0.25:
            return [
              "bell blues",
              randomColoursFromPalettes(blue2, blue2, blue2mono),
            ];
          case scale <= 0.375:
            return [
              "turquoise blues",
              randomColoursFromPalettes(blue3, blue3, blue3mono),
            ];
          case scale <= 0.5:
            return [
              "reddish blues",
              randomColoursFromPalettes(blue3mono, red2mono, blue1mono),
            ];
          case scale <= 0.625:
            return [
              "bluish reds",
              randomColoursFromPalettes(red3mono, blue2mono, red1mono),
            ];
          case scale <= 0.75:
            return [
              "chablis reds",
              randomColoursFromPalettes(red3, red3, red3mono),
            ];
          case scale <= 0.875:
            return [
              "pink reds",
              randomColoursFromPalettes(red2, red2, red2mono),
            ];
          default:
            return [
              "jam reds",
              randomColoursFromPalettes(red1, red1, red1mono),
            ];
        }
      }

      function getShape() {
        let blockNumber = block;
        switch (true) {
          case blockNumber % 30 === 0:
            return { shape: "pentagonal delta orb", count: 30 };
          case blockNumber % 24 === 0:
            return { shape: "square delta orb", count: 24 };
          case blockNumber % 18 === 0:
            return { shape: "hexagonal jewel", count: 18 };
          case blockNumber % 15 === 0:
            return { shape: "pentagonal jewel", count: 15 };
          case blockNumber % 12 === 0:
            return { shape: "square jewel", count: 12 };
          default:
            return { shape: "Toshie's jewel", count: 3 };
        }
      }

      function getGLTF() {
        let blockNumber = block;
        switch (true) {
          case blockNumber % 30 === 0:
            return pentagonalDeltaOrb;
          case blockNumber % 24 === 0:
            return squareDeltaOrb;
          case blockNumber % 18 === 0:
            return hexagonalJewel;
          case blockNumber % 15 === 0:
            return pentagonalJewel;
          case blockNumber % 12 === 0:
            return squareJewel;
          default:
            return ToshiesJewel;
        }
      }

      function getSymmetry() {
        let count = parseInt(ethTransferred / getShape().count);
        let symmetry = 1;
        for (let i = 36; i > 0; i--) {
          if (count % i === 0) {
            symmetry = i;
            break;
          }
        }
        return symmetry;
      }

      function getModelCount() {
        let count = parseInt(ethTransferred / getShape().count / getSymmetry());
        if (count > 216) {
          count = 216;
        }
        return count;
      }

      function getShapeCount() {
        let count = block;
        if (count > 36) {
          count = 36;
        } else if (count < 6) {
          count = 6;
        }
        return count;
      }

      let jewelConfig = [];
      for (let i = 0; i < getModelCount(); i++) {
        jewelConfig.push({
          position: randomPositionOnHemisphere(),
          rotation: randomRotation(),
        });
      }
      const colourConfig = selectColours();
      const colours = colourConfig[1];
      const scale = getScale();
      const shape = getModelCount() === 0 ? "none" : getShape().shape;
      const symmetry = getSymmetry();
      const gltf = getGLTF();

      const attributes = {
        color: colourConfig[0],
        shape: shape,
        symmetry: symmetry,
      };
      hoistedValue.current = attributes;

      let shapeConfig = [];
      for (let i = 0; i < getShapeCount(); i++) {
        shapeConfig.push({
          position: randomPositionOnHemisphere(),
          rotation: randomRotation()[0],
        });
      }

      return [jewelConfig, shapeConfig, colours, scale, symmetry, gltf];
    }, [block]);

  //Load jewelConfig
  const jewelsGroup = React.useRef();
  function Jewels(props) {
    let jewelConfig = props.jewelConfig;
    let scale = props.scale;
    let mod1 = props.mod1 * 0.8 + 0.2;
    let base = jewelConfig.length * props.symmetry > 36 ? props.mod1 / 2 : mod1;
    const buffer1 = JSON.stringify(props.gltf);
    const { scene } = useAsset(
      (buffer) =>
        new Promise((res, rej) =>
          new GLTFLoader().parse(buffer1, "", res, rej)
        ),
      [buffer1]
    );
    const { nodes } = useGraph(scene);
    const jewels = [];
    if (jewelConfig.length > 0) {
      if (jewelConfig.length === 1 && props.symmetry === 1) {
        jewelConfig[0].position = [0, 0, 0];
        scale = 0.006;
        mod1 = 1;
      }
      const body1Array = [];
      const body2Array = [];
      const body3Array = [];
      jewelConfig.forEach((item) => {
        let body1Clone = nodes.Body1.geometry.clone();
        body1Clone.rotateX(item.rotation[0]);
        body1Clone.rotateY(item.rotation[1]);
        body1Clone.rotateZ(item.rotation[2]);
        body1Clone.scale(scale, scale, scale);
        body1Clone.translate(
          item.position[0],
          item.position[1],
          item.position[2]
        );
        body1Array.push(body1Clone);
        let body2Clone = nodes.Body2.geometry.clone();
        body2Clone.rotateX(item.rotation[0]);
        body2Clone.rotateY(item.rotation[1]);
        body2Clone.rotateZ(item.rotation[2]);
        body2Clone.scale(scale, scale, scale);
        body2Clone.translate(
          item.position[0],
          item.position[1],
          item.position[2]
        );
        body2Array.push(body2Clone);
        let body3Clone = nodes.Body3.geometry.clone();
        body3Clone.rotateX(item.rotation[0]);
        body3Clone.rotateY(item.rotation[1]);
        body3Clone.rotateZ(item.rotation[2]);
        body3Clone.scale(scale, scale, scale);
        body3Clone.translate(
          item.position[0],
          item.position[1],
          item.position[2]
        );
        body3Array.push(body3Clone);
      });
      const body1Merged = BufferGeometryUtils.mergeBufferGeometries(
        body1Array,
        false
      );
      const body2Merged = BufferGeometryUtils.mergeBufferGeometries(
        body2Array,
        false
      );
      const body3Merged = BufferGeometryUtils.mergeBufferGeometries(
        body3Array,
        false
      );
      let colour1Start = props.colour1.toString(16);
      colour1Start = "#" + colour1Start.padStart(6, "0");
      let colour1End = (0xffffff - props.colour1).toString(16);
      colour1End = "#" + colour1End.padStart(6, "0");
      let colour2Start = props.colour2.toString(16);
      colour2Start = "#" + colour2Start.padStart(6, "0");
      let colour2End = (0xffffff - props.colour2).toString(16);
      colour2End = "#" + colour2End.padStart(6, "0");
      let colour3Start = props.colour3.toString(16);
      colour3Start = "#" + colour3Start.padStart(6, "0");
      let colour3End = (0xffffff - props.colour3).toString(16);
      colour3End = "#" + colour3End.padStart(6, "0");
      let colour1Range = new ColorJS(colour1Start).range(
        new ColorJS(colour1End),
        {
          space: "xyz",
        }
      );
      let colour2Range = new ColorJS(colour2Start).range(
        new ColorJS(colour2End),
        {
          space: "xyz",
        }
      );
      let colour3Range = new ColorJS(colour3Start).range(
        new ColorJS(colour3End),
        {
          space: "xyz",
        }
      );
      if (props.symmetry === 1 && jewelConfig.length !== 1) {
        jewels.push(
          <group>
            <mesh geometry={body1Merged} renderOrder={1296}>
              <meshPhysicalMaterial
                transparent={true}
                transmission={(-1 * mod1 + 1) * (1 - base)}
                color={new Color(
                  colour1Range(0).toHex({ alpha: false, collapse: false })
                ).convertGammaToLinear()}
              />
            </mesh>
            <mesh geometry={body2Merged} renderOrder={1297}>
              <meshPhysicalMaterial
                transparent={true}
                transmission={((-1 / 3) * mod1 + 1) * (1 - base)}
                color={new Color(
                  colour2Range((2 / 3) * props.mod3).toHex({
                    alpha: false,
                    collapse: false,
                  })
                ).convertGammaToLinear()}
              />
            </mesh>
            <mesh geometry={body3Merged} renderOrder={1297}>
              <meshPhysicalMaterial
                transparent={true}
                transmission={((-1 / 3) * mod1 + 1) * (1 - base)}
                color={new Color(
                  colour3Range((2 / 3) * props.mod3).toHex({
                    alpha: false,
                    collapse: false,
                  })
                ).convertGammaToLinear()}
              />
            </mesh>
          </group>
        );
      } else {
        for (let i = 0; i < props.symmetry; i++) {
          jewels.push(
            <group
              key={i}
              rotation={[0, 0, ((2 * Math.PI) / props.symmetry) * i]}
              renderOrder={
                Math.abs(props.symmetry / 2 - i) * -1 +
                props.symmetry / 2 +
                1296
              }
            >
              <mesh geometry={body1Merged}>
                <meshPhysicalMaterial
                  transparent={true}
                  transmission={
                    (Math.abs((2 / props.symmetry) * i - 1) * -1 * mod1 + 1) *
                    (1 - base)
                  }
                  color={new Color(
                    colour1Range(
                      (Math.abs((2 / props.symmetry) * i - 1) * -1 + 1) *
                        props.mod3
                    ).toHex({ alpha: false, collapse: false })
                  ).convertGammaToLinear()}
                />
              </mesh>
              <mesh geometry={body2Merged}>
                <meshPhysicalMaterial
                  transparent={true}
                  transmission={
                    (Math.abs((2 / props.symmetry) * i - 1) * -1 * mod1 + 1) *
                    (1 - base)
                  }
                  color={new Color(
                    colour2Range(
                      (Math.abs((2 / props.symmetry) * i - 1) * -1 + 1) *
                        props.mod3
                    ).toHex({ alpha: false, collapse: false })
                  ).convertGammaToLinear()}
                />
              </mesh>
              <mesh geometry={body3Merged}>
                <meshPhysicalMaterial
                  transparent={true}
                  transmission={
                    (Math.abs((2 / props.symmetry) * i - 1) * -1 * mod1 + 1) *
                    (1 - base)
                  }
                  color={new Color(
                    colour3Range(
                      (Math.abs((2 / props.symmetry) * i - 1) * -1 + 1) *
                        props.mod3
                    ).toHex({ alpha: false, collapse: false })
                  ).convertGammaToLinear()}
                />
              </mesh>
            </group>
          );
        }
      }
    }

    // Animate jewels
    useFrame(() => {
      if (jewelsGroup.current) {
        let transform1 =
          (mod1 *
            (Math.sin(clock.getElapsedTime() * (1 - props.mod2) * 3) + 1)) /
          2;
        let transform2 = clock.getElapsedTime() * (1 - props.mod2);
        if (props.symmetry === 1 && jewelConfig.length === 1) {
          jewelsGroup.current.children[0].rotation.y =
            -1 * transform2 * ((props.colour1 % 6) + 0.6);
          jewelsGroup.current.children[0].rotation.z =
            transform2 * ((props.colour2 % 6) + 0.6);
        } else if (props.symmetry === 1 && jewelConfig.length !== 1) {
          jewelsGroup.current.children[0].children[0].material.transmission =
            (-1 * mod1 + 1) * (1 - transform1);
          jewelsGroup.current.children[0].children[1].material.transmission =
            ((-1 / 3) * mod1 + 1) * (1 - transform1);
          jewelsGroup.current.children[0].children[2].material.transmission =
            ((-1 / 3) * mod1 + 1) * (1 - transform1);
        } else if (props.symmetry * jewelConfig.length > 36) {
          let i = 0;
          jewelsGroup.current.children.forEach((group) => {
            group.children[0].material.transmission =
              (Math.abs((2 / props.symmetry) * i - 1) * -1 * mod1 + 1) *
              (1 - transform1);
            group.children[1].material.transmission =
              (Math.abs((2 / props.symmetry) * i - 1) * -1 * mod1 + 1) *
              (1 - transform1);
            group.children[2].material.transmission =
              (Math.abs((2 / props.symmetry) * i - 1) * -1 * mod1 + 1) *
              (1 - transform1);
            i++;
          });
        }
      }
      invalidate();
    });

    return <group ref={jewelsGroup}>{jewels}</group>;
  }

  //Load shapeConfig
  const shapesGroup = React.useRef();
  function Shapes(props) {
    const shapes = [];
    const shapeArray = [];
    let symmetry = props.symmetry;
    let mod1 = props.mod1 * 0.8 + 0.1;
    let sides = 3;
    for (let i = 6; i >= 3; i--) {
      if (symmetry % i === 0) {
        sides = i;
        break;
      }
    }
    while (symmetry * props.shapeConfig.length < 36) {
      symmetry *= 2;
    }
    props.shapeConfig.forEach((item) => {
      let shape = new CircleBufferGeometry(36, sides);
      shape.rotateZ(item.rotation);
      shape.scale(props.scale, props.scale, props.scale);
      shape.translate(item.position[0], item.position[1], item.position[2]);
      shapeArray.push(shape);
    });
    const shapeMerged = BufferGeometryUtils.mergeBufferGeometries(
      shapeArray,
      false
    );
    for (let i = 0; i < symmetry; i++) {
      let colourStart = props.colours[i % 3].toString(16);
      colourStart = "#" + colourStart.padStart(6, "0");
      let colourEnd = (0xffffff - props.colours[i % 3]).toString(16);
      colourEnd = "#" + colourEnd.padStart(6, "0");
      let colourRange = new ColorJS(colourStart).range(new ColorJS(colourEnd), {
        space: "lch",
      });
      if (symmetry === 1) {
        shapes.push(
          <group
            key={i}
            rotation={[0, 0, ((2 * Math.PI) / symmetry) * i]}
            renderOrder={i}
          >
            <mesh geometry={shapeMerged}>
              <meshPhysicalMaterial
                side={DoubleSide}
                transparent={true}
                transmission={mod1}
                color={new Color(
                  colourRange(props.mod3).toHex({
                    alpha: false,
                    collapse: false,
                  })
                ).convertGammaToLinear()}
                depthTest={false}
              />
            </mesh>
          </group>
        );
      } else {
        shapes.push(
          <group
            key={i}
            rotation={[0, 0, ((2 * Math.PI) / symmetry) * i]}
            renderOrder={i}
          >
            <mesh geometry={shapeMerged}>
              <meshPhysicalMaterial
                side={DoubleSide}
                transparent={true}
                transmission={mod1}
                color={new Color(
                  colourRange(
                    (Math.abs((2 / symmetry) * i - 1) * -1 + 1) * props.mod3
                  ).toHex({ alpha: false, collapse: false })
                ).convertGammaToLinear()}
                depthTest={false}
              />
            </mesh>
          </group>
        );
      }
    }

    // Animate shapes
    const roundedSquareWave = (t, delta, a, f) => {
      return (
        (a / Math.atan(1 / delta)) *
        Math.atan(Math.sin(2 * Math.PI * t * f) / delta)
      );
    };
    useFrame(() => {
      if (shapesGroup.current) {
        let transform1 =
          Math.sqrt(
            Math.pow(camera.position.x, 2) + Math.pow(camera.position.y, 2)
          ) * 0.6;
        let transform2 = 0;
        let time = clock.getElapsedTime();
        let i = 0;
        shapesGroup.current.children.forEach((group) => {
          let alpha = Math.abs((2 / symmetry) * i - 1) * -1 + 1;
          let scale = Math.abs(transform1) * (alpha - 1) + 1;
          group.scale.set(scale, scale, scale);
          if (!(props.symmetry === 1 && jewelConfig.length === 1)) {
            if (props.shapeConfig.length % 2 === 0) {
              let transform3 =
                ((1 - mod1) *
                  (Math.sin(
                    time * (1 - props.mod2) * 6 -
                      Math.PI / 2 +
                      (props.mod2 === 1 ? 0 : i)
                  ) +
                    1)) /
                  2 +
                mod1;
              group.children[0].material.transmission = transform3;
            } else {
              let transform3 =
                props.mod2 === 1
                  ? mod1
                  : roundedSquareWave(
                      time * (1 - props.mod2) * 6 - 1.5 + i,
                      0.5,
                      (1 - mod1) / 2,
                      1 / 6
                    ) +
                    (mod1 + 1) / 2;
              group.children[0].material.transmission = transform3;
            }
          }
          i++;
        });
        shapesGroup.current.rotation.set(0, 0, transform2 * Math.PI);
      }
      invalidate();
    });

    return <group ref={shapesGroup}>{shapes}</group>;
  }

  // Reset clock on mod2 change
  useEffect(() => {
    clock.start();
    // eslint-disable-next-line
  }, [mod2]);

  // Reset camera position
  let originVector2 = new Vector2(0, 0);
  let originVector3 = new Vector3(0, 0, 1);
  useFrame(() => {
    if (mouse.distanceTo(originVector2) > 1) {
      camera.position.lerp(originVector3, 0.06);
    }
  });

  // Render the scene
  function getSpeed() {
    return ((scale - 0.001) / 0.002) * 0.05 + 0.01;
  }
  return (
    <>
      <OrbitControls
        enablePan={false}
        enableZoom={false}
        enableDamping={true}
        dampingFactor={0.06}
        rotateSpeed={getSpeed()}
        minAzimuthAngle={-Math.PI / 12}
        maxAzimuthAngle={Math.PI / 12}
        minPolarAngle={(Math.PI * 5) / 12}
        maxPolarAngle={(Math.PI * 7) / 12}
      />
      <group ref={group} position={[0, 0, 0]}>
        <directionalLight position={[0, 0, 1]} />
        <directionalLight
          position={[0, 0, 1]}
          intensity={color1 === "#ffffff" ? 0 : 1}
          color={color1}
        />
        <Suspense fallback={null}>
          {jewelConfig.length > 0 ? (
            <Jewels
              gltf={gltf}
              colour1={colours[0]}
              colour2={colours[1]}
              colour3={colours[2]}
              scale={scale}
              jewelConfig={jewelConfig}
              symmetry={symmetry}
              mod1={mod1}
              mod2={mod2}
              mod3={mod3}
            />
          ) : (
            <></>
          )}
          {jewelConfig.length * symmetry <= 36 ? (
            <Shapes
              colours={colours}
              scale={scale}
              shapeConfig={shapeConfig}
              symmetry={symmetry}
              mod1={mod1}
              mod2={mod2}
              mod3={mod3}
            />
          ) : (
            <></>
          )}
        </Suspense>
      </group>
    </>
  );
}

const Outer = React.memo(({ ...props }) => {
  return (
    <Canvas
      id="canvasId"
      key="canvas"
      invalidateFrameloop
      colorManagement
      orthographic
      camera={{ zoom: 300, position: [0, 0, 1] }}
      pixelRatio={window.devicePixelRatio}
      sx={{
        width: "100%",
        height: "100%",
      }}
    >
      <CustomStyle {...props} />
    </Canvas>
  );
});

export default Outer;
